(1, NULL, 0, 'R1-001', 'el-tradicional-3-roses', 'el-tradicional-3-roses', 'el-tradicional-3-roses', '{\"es\":\"EL TRADICIONAL (3 rosas)\",\"ca\":\"EL TRADICIONAL (3 rosas)\",\"en\":\"EL TRADICIONAL (3 rosas)\",\"ru\":\"EL TRADICIONAL (3 rosas)\"}', '0RR0', 'blancas|rojas|rosas', 'simple', '{\"es\":\"De la rosa nacimos y en la rosa volveremos. Un clásico, un tradicional, el ramo perfecto para que sobran las palabras.El ramo de rosas rojas a domicilio ha sido nuestra motivación inicial, sabemos que no existe flor mejor para hacer llegar un mensaje amor. Entregado en semifloración para poder disfrutar de toda su belleza visual y aromática al recibirlo en casa, siempre acompañado de los mejores frescos verdes en botánica, que harán que tus rosas rojas luzcan mucho más.Decídete por la tímida opción de tres rosas para declararte por primera vez; el ramo tradicional de seis rosas para demostrar el amor eterno o la extrema perfección de los ramos: el ramo de doce rosas rojas a domicilio.Si tienes que hablar de amor, díselo con rosas rojas entregadas en casa.\",\"ca\":\"De la rosa nacimos y en la rosa volveremos. Un clásico, un tradicional, el ramo perfecto para que sobran las palabras.El ramo de rosas rojas a domicilio ha sido nuestra motivación inicial, sabemos que no existe flor mejor para hacer llegar un mensaje amor. Entregado en semifloración para poder disfrutar de toda su belleza visual y aromática al recibirlo en casa, siempre acompañado de los mejores frescos verdes en botánica, que harán que tus rosas rojas luzcan mucho más.Decídete por la tímida opción de tres rosas para declararte por primera vez; el ramo tradicional de seis rosas para demostrar el amor eterno o la extrema perfección de los ramos: el ramo de doce rosas rojas a domicilio.Si tienes que hablar de amor, díselo con rosas rojas entregadas en casa.\",\"en\":\"De la rosa nacimos y en la rosa volveremos. Un clásico, un tradicional, el ramo perfecto para que sobran las palabras.El ramo de rosas rojas a d