(2, NULL, 0, 'P1-001', 'orquidea-bali', 'orquidea-bali', 'orquidea-bali', '{\"es\":\"BALI\",\"ca\":\"BALI\",\"en\":\"BALI\",\"ru\":\"BALI\"}', '0PI0|0PE0', 'Plantes grans', 'simple', '{\"es\":\"Las orquídeas son una de las plantas más populares en las casas de todo el mundo. Son reconocidas por mejorar la calidad del aire, aportando oxígeno limpio y fresco, y absorbiendo el xileno, un elemento encontrado en las colas, pinturas y barnices. También, como consecuencia de esto, son capaces de reducir el estrés y el dolor de cabeza, aportando calma y mejorando el flujo de las energías. Viendo estas propiedades, la convierte en una planta perfecta para regalar cuando alguien se muda.Estas juegan un papel importante en el Feng Shui, teniendo una relación directa con la buena suerte y el éxito en los proyectos de vida. Con todos estos beneficios, es difícil no caer en la tentación de adoptar a esta planta. ¿Te animas a cuidar de esta pequeña?Una oda a la elegancia, la belleza y el amor.  Tiesto no incluido.&nbsp;: Cada 6-10 días. Sumergirla en agua durante unos 20 minutos.&nbsp;: Luz indirecta&nbsp;: Cálido, que no supere los 30 °C ni baje de los 10 °C&nbsp;: Interior&nbsp;: Altura superior a 80 cm&nbsp;: Sí\",\"ca\":\"Las orquídeas son una de las plantas más populares en las casas de todo el mundo. Son reconocidas por mejorar la calidad del aire, aportando oxígeno limpio y fresco, y absorbiendo el xileno, un elemento encontrado en las colas, pinturas y barnices. También, como consecuencia de esto, son capaces de reducir el estrés y el dolor de cabeza, aportando calma y mejorando el flujo de las energías. Viendo estas propiedades, la convierte en una planta perfecta para regalar cuando alguien se muda.Estas juegan un papel importante en el Feng Shui, teniendo una relación directa con la buena suerte y el éxito en los proyectos de vida. Con todos estos beneficios, es difícil no caer en la tentación de adoptar a esta planta. ¿Te animas a cuidar de esta pequeña?Una oda a la el