(3, NULL, 0, 'R1-004', 'roman-de-cinema', 'roman-de-cinema', 'roman-de-cinema', '{\"es\":\"ROMANCE DE CINE\",\"ca\":\"ROMANCE DE CINE\",\"en\":\"ROMANCE DE CINE\"}', '0RV0', 'Alheli|claveles|eustoma|rojas|rosas', 'simple', '{\"es\":\"El amor de cine no existe, o sí... Cada relación es un mundo y cada persona es capaz de vivir las emociones de una manera diferente. Aún así, es intensa.Nuestro romance de cine está pensado para demostrar que el amor de las películas sí existe. Si has encontrado tu Bonnie y no quieres que nada ni nadie pueda desviar su atención, esta es la manera de conseguirlo sin el uso de palabras.Regalar ramos de flores a domicilio es la mejor manera de hacer que tu mensaje llegue al destinatario alto y claro. ¿Hay algo mejor que las rosas para demostrar amor? ¡Sí! Rosas, claveles,lisanthus y manthiolas, entregados en semi floración para poder disfrutar de todo su aroma y belleza visual en el momento de la entrega. La mejor selección acompañada de fresco botánico verde para acentuar los maravillosos colores que el amor nos permite ver. Jarrón no incluido\",\"ca\":\"El amor de cine no existe, o sí... Cada relación es un mundo y cada persona es capaz de vivir las emociones de una manera diferente. Aún así, es intensa.Nuestro romance de cine está pensado para demostrar que el amor de las películas sí existe. Si has encontrado tu Bonnie y no quieres que nada ni nadie pueda desviar su atención, esta es la manera de conseguirlo sin el uso de palabras.Regalar ramos de flores a domicilio es la mejor manera de hacer que tu mensaje llegue al destinatario alto y claro. ¿Hay algo mejor que las rosas para demostrar amor? ¡Sí! Rosas, claveles,lisanthus y manthiolas, entregados en semi floración para poder disfrutar de todo su aroma y belleza visual en el momento de la entrega. La mejor selección acompañada de fresco botánico verde para acentuar los maravillosos colores que el amor nos permite ver. Jarrón no incluido\",\"en\":\"El amor de cine no existe, o sí... C