(47, NULL, 0, 'P1-0020', 'lirio-de-la-paz-honduras', 'lirio-de-la-paz-honduras', 'lirio-de-la-paz-honduras', '{\"es\":\"HONDURAS\",\"ca\":\"HONDURAS\",\"en\":\"HONDURAS\",\"ru\":\"HONDURAS\"}', '0PI0|0PE0', '', 'simple', '{\"es\":\"Conocido también como Lirio de la paz o Bandera blanca, el Espatifilio es una de esas plantas resistentes que te dan mucho más de lo que piden. Aparte de tener unos cuidados muy sencillos, cuenta con unas propiedades que la hacen muy valorada, como la de purificar y humidificar el aire. ¡Una manera natural de sustituir los purificadores artificiales! Esto ayuda a reducir los niveles de ansiedad de aquellos que lo rodean, proporcionando un mejor descanso si decides ubicarla en la habitación. Más allá de sus propiedades, una de las características más llamativas es que el Espatifilio florece todo el año, permitiendo tener un elemento de decoración permanente. Ya has visto que por sus cualidades y beneficios, se trata de una planta ideal para regalar. O incluso para regalarte a ti mismo. ¿Ya te has decidido? ¡Adelante!&nbsp;Tiesto no incluido.Planta mediana: Altura entre 40 y 60 cm.\",\"ca\":\"Conocido también como Lirio de la paz o Bandera blanca, el Espatifilio es una de esas plantas resistentes que te dan mucho más de lo que piden. Aparte de tener unos cuidados muy sencillos, cuenta con unas propiedades que la hacen muy valorada, como la de purificar y humidificar el aire. ¡Una manera natural de sustituir los purificadores artificiales! Esto ayuda a reducir los niveles de ansiedad de aquellos que lo rodean, proporcionando un mejor descanso si decides ubicarla en la habitación. Más allá de sus propiedades, una de las características más llamativas es que el Espatifilio florece todo el año, permitiendo tener un elemento de decoración permanente. Ya has visto que por sus cualidades y beneficios, se trata de una planta ideal para regalar. O incluso para regalarte a ti mismo. ¿Ya te has decidido? ¡Adelante!&nbsp;Tiesto no incluido.Planta media