(169, NULL, 0, 'R1-001-1', 'rosa-sant-jordi-regalo', 'rosa-sant-jordi-regalo', 'rosa-sant-jordi-regalo', '{\"es\":\"ROSA SUPREME\",\"ca\":\"ROSA SUPREME\",\"en\":\"ROSA SUPREME\"}', '0RR0|0OSJ0', 'blancas|rojas|rosas', 'simple', '{\"es\":\"De la rosa nacimos y en la rosa volveremos. Un clásico, un tradicional, el ramo rosa premium para que sobran las palabras.El ramo de rosas rojas a domicilio ha sido nuestra motivación inicial, sabemos que no existe flor mejor para hacer llegar un mensaje amor. Entregado en semifloración para poder disfrutar de toda su belleza visual y aromática al recibirlo en casa, siempre acompañado de los mejores frescos verdes en botánica, que harán que tus rosas rojas luzcan mucho más.Decídete por la tímida opción de tres rosas para declararte por primera vez; el ramo tradicional de seis para demostrar el amor eterno o la extrema perfección de los ramos: el ramo de doce rosas rojas a domicilio.Si tienes que hablar de amor, díselo con rosas rojas entregadas en casa.\",\"ca\":\"De la rosa nacimos y en la rosa volveremos. Un clásico, un tradicional, el ramo rosa premium para que sobran las palabras.El ramo de rosas rojas a domicilio ha sido nuestra motivación inicial, sabemos que no existe flor mejor para hacer llegar un mensaje amor. Entregado en semifloración para poder disfrutar de toda su belleza visual y aromática al recibirlo en casa, siempre acompañado de los mejores frescos verdes en botánica, que harán que tus rosas rojas luzcan mucho más.Decídete por la tímida opción de tres rosas para declararte por primera vez; el ramo tradicional de seis para demostrar el amor eterno o la extrema perfección de los ramos: el ramo de doce rosas rojas a domicilio.Si tienes que hablar de amor, díselo con rosas rojas entregadas en casa.\",\"en\":\"De la rosa nacimos y en la rosa volveremos. Un clásico, un tradicional, el ramo rosa premium para que sobran las palabras.El ramo de rosas rojas a domicilio ha sido nuestra motivación inicial, sabemos que no existe flor mejor para hacer llegar un mensaje amor. Entregado en semifloración para poder disfrutar de toda su belleza visual y aromática al recibirlo en casa, siempre acompañado de los mejores frescos verdes en botánica, que harán que tus rosas rojas luzcan mucho más.Decídete por la tímida opción de tres rosas para declararte por primera vez; el ramo tradicional de seis para demostrar el amor eterno o la extrema perfección de los ramos: el ramo de doce rosas rojas a domicilio.Si tienes que hablar de amor, díselo con rosas rojas entregadas en casa.\"}', 'rosa-sant-jordi-regalo.jpg|rosa-sant-jordi-regalo_1.jpg', 15.90, 0.00, '10', 1.30, '0x0x0', 0.00, '{\"es\":{\"title\":\"Rosa Sant Jordi Con Envío A Domicilio - ROSISTIREM\",\"description\":\"Rosa de Sant Jordi Supreme para envío a domicilio. Un regalo original para la Diada y con entrega el 23 de abril.\"},\"ca\":{\"title\":\"Rosa Sant Jordi Con Envío A Domicilio - ROSISTIREM\",\"description\":\"Rosa de Sant Jordi Supreme para envío a domicilio. Un regalo original para la Diada y con entrega el 23 de abril.\"},\"en\":{\"title\":\"Rosa Sant Jordi Con Envío A Domicilio - ROSISTIREM\",\"description\":\"Rosa de Sant Jordi Supreme para envío a domicilio. Un regalo original para la Diada y con entrega el 23 de abril.\"},\"ru\":{\"title\":\"Rosa Sant Jordi Con Envío A Domicilio - ROSISTIREM\",\"description\":\"Rosa de Sant Jordi Supreme para envío a domicilio. Un regalo original para la Diada y con entrega el 23 de abril.\"}}', 'Ocasiones Especiales>San Valentín|Ocasiones Especiales>Sant Jordi|Ramos Flores|Ramos Flores>Flores rojas|Rosas|Todos los Productos', '', 1, '2021-10-03 06:57:03', '2022-02-03 12:29:01'),
