(175, NULL, 0, '', 'ocaso-bouquet-variado', 'ocaso-bouquet-variado', 'ocaso-bouquet-variado', '{\"es\":\"OCASO\",\"ca\":\"OCASO\",\"en\":\"OCASO\",\"ru\":\"OCASO\"}', '0RV0', '', 'variable', '{\"es\":\"Sin duda, uno de los momentos más mágicos que nos regala el día es el ocaso: el proceso en el cual el Sol cruza el horizonte. Parte del encanto de este fenómeno reside en los colores que adquiere el cielo, los cuales pasan por cálidos naranjas y envolventes lilas, entre otros. En honor a este precioso fenómeno, os presentamos la colección de ramos Ocaso.Cada persona es un mundo, así que te ofrecemos la posibilidad de regalarlo en color naranja o en color lila, para que elijas el que más se adecúa a esa persona especial. También, puedes escoger la versión premium, que cuenta con rosas, crisantemos, orquídeas y gerberas, o la versión supreme, la cual contiene hortensias, rosas, gerberas y orquídeas.Regala este ramo a domicilio a aquella persona con la que te gustaría contemplar el ocaso por el resto de la eternidad. Y añádele una dedicatoria personalizada para decirle todo lo que es para ti.\",\"ca\":\"Sin duda, uno de los momentos más mágicos que nos regala el día es el ocaso: el proceso en el cual el Sol cruza el horizonte. Parte del encanto de este fenómeno reside en los colores que adquiere el cielo, los cuales pasan por cálidos naranjas y envolventes lilas, entre otros. En honor a este precioso fenómeno, os presentamos la colección de ramos Ocaso.Cada persona es un mundo, así que te ofrecemos la posibilidad de regalarlo en color naranja o en color lila, para que elijas el que más se adecúa a esa persona especial. También, puedes escoger la versión premium, que cuenta con rosas, crisantemos, orquídeas y gerberas, o la versión supreme, la cual contiene hortensias, rosas, gerberas y orquídeas.Regala este ramo a domicilio a aquella persona con la que te gustaría contemplar el ocaso por el resto de la eternidad. Y añádele una dedicatoria personalizada para decirle todo 