(192, NULL, 0, 'SV-005', 'frasquito-petalos-y-pergaminos', 'frasquito-petalos-y-pergaminos', 'frasquito-petalos-y-pergaminos', '{\"es\":\"UN ROLLO\",\"ca\":\"UN ROLLO\",\"en\":\"UN ROLLO\"}', '0RR0|0OSV0', 'Pétalos', 'simple', '{\"es\":\"Este es un regalo único para la persona que quiera poner sus sentimientos en palabras. Un potecito de cristal que contiene pétalos de rosa roja donde se esconden diez razones en formato de pergamino, las cuales exponen todo lo que siente hacia la otra.\",\"ca\":\"Aquest és un regal únic per a la persona que vulgui possar els seus sentiments en paraules. Un potet de vidre que conté pétals de rosa vermella on s ́amaguen deu raons en format de pergamí, les quals exposen tot el que sent per l ́altre.\",\"en\":\"This is a unique gift for the person that wants to put all their feelings into words. A crystal pot which contains red rose petals, where 10 different reasons are hidden in mini parchment format, revealing everything that one feels for the other.\"}', 'frasquito-petalos-y-pergaminos.jpg', 21.90, 0.00, '', 0.00, '', 0.00, '', '', '', 1, '2022-02-01 07:32:08', '2022-02-02 11:34:46'),
(193, NULL, 0, 'SV-001-1', 'combo-transparente-1-l-rojo', 'combo-transparente-1-l-rojo', 'combo-transparente-1-l-rojo', '{\"es\":\"AMOR PASIONAL\",\"ca\":\"AMOR PASIONAL\",\"en\":\"AMOR PASIONAL\"}', '0RR0|0OSV0', 'Rosas|Bombones', 'simple', '{\"es\":\"Este combo tan extravagante, hecho con una caja negra y transparente llena de rosas rojas y bombones, hará que el resto del día sea todavía más especial, disfrutando de una cena con velas, acompañado de un regalo lleno de amor y dulzura. ¡Un postre asegurado!\",\"ca\":\"Aquest combo tant extravagant fet amb una caixa negre i transparent omplerta de roses vermelles i bombos, fará que el resta del dia sigui encara més especial, disfrutant d\'un sopar amb espelmes, acompanyat d\'un regal ple d\'amor i de dolçor. Un postre assegurat!\",\"en\":\"This fancy combo, made with a blach and transparent box filled with red roses and Ferrero Rocher box, will make the rest of the day even more special, enjoying a romantic dinner surrounded by candlelights and complementing it with a very special gift full of love and sweetness. Guarantee your dessert!\"}', 'combo-transparente-1-l-rojo.jpg', 132.00, 0.00, '', 0.00, '', 0.00, '', '', '', 1, '2022-02-01 07:54:08', '2022-02-02 12:45:46'),
