(195, NULL, 0, 'SV-001-3', 'combo-transparente-1-m-rojo', 'combo-transparente-1-m-rojo', 'combo-transparente-1-m-rojo', '{\"es\":\"SOMOS NOVIOS\",\"ca\":\"SOMOS NOVIOS\",\"en\":\"SOMOS NOVIOS\"}', '0OSV0', '', 'simple', '{\"es\":\"Este combo tan extravagante, hecho con una caja negra y transparente llena de rosas rojas y unos bombones, hará que el resto del día sea todavía más especial, disfrutando de una cena con velas, acompañado de un regalo lleno de amor y dulzura. ¡Un postre asegurado!\",\"ca\":\"Aquest combo tant extravagant fet amb una caixa negre i transparent omplerta de roses vermelles i uns quants bombos, fará que el resta del dia sigui encara més especial, disfrutant d\'un sopar amb espelmes, acompanyat d\'un regal ple d\'amor i de dolçor. Un postre assegurat!\",\"en\":\"This fancy combo, made with a blach and transparent box filled with red roses and a few Ferrero Rocher chocolates, will make the rest of the day even more special, enjoying a romantic dinner surrounded by candlelights and complementing it with a very special gift full of love and sweetness. Guarantee your dessert!\"}', 'combo-transparente-1-m-rojo.jpg', 91.00, 0.00, '', 0.00, '', 0.00, '', '', '', 1, '2022-02-01 07:58:05', '2022-02-02 12:47:12'),
(196, NULL, 0, 'SV-001-4', 'combo-transparente-1-m-rosa', 'combo-transparente-1-m-rosa', 'combo-transparente-1-m-rosa', '{\"es\":\"¿QUIERES SER MI @?\",\"ca\":\"¿QUIERES SER MI @?\",\"en\":\"¿QUIERES SER MI @?\"}', '0OSV0', '', 'simple', '{\"es\":\"Atrévete a hacerle la pregunta tan esperada. Este combo tan extravagante, hecho con una caja negra y transparente llena de rosas de color rosa y bombones, hará que el resto del día sea todavía más especial, disfrutando de una cena con velas, acompañado de un regalo lleno de amor y dulzura. ¡Te habrás garantizado un SÍ!\",\"ca\":\"Atreveix-te a fer-li la pregunta tan esperada. Aquest combo tant extravagant fet amb una caixa negre i transparent omplerta de roses roses i bombos, fará que el resta del dia sigui encara més especial, disfrutant d\'un sopar amb espelmes, acompanyat d\'un regal ple d\'amor i de dolçor. T ́haurás assegurat un SI!\",\"en\":\"Ask the so-desired question already. This fancy combo, made with a blach and transparent box filled with pink roses and Ferrero Rocher box, will make the rest of the day even more special, enjoying a romantic dinner surrounded by candlelights and complementing it with a very special gift full of love and sweetness. It will guarantee a YES!\"}', 'combo-transparente-1-m-rosa.jpg', 91.00, 0.00, '', 0.00, '', 0.00, '', '', '', 1, '2022-02-01 07:59:03', '2022-02-02 12:47:51'),
(197, NULL, 0, 'SV-001-5', 'combo-transparente-2-l-rojo', 'combo-transparente-2-l-rojo', 'combo-transparente-2-l-rojo', '{\"es\":\"MI VIDA\",\"ca\":\"MI VIDA\",\"en\":\"MI VIDA\"}', '0OSV0', '', 'simple', '{\"es\":\"Expresar lo que uno siente es igual de difícil que aceptarlo uno mismo. Por eso, este combo lo dirá todo por tí. Unas cuantas rosas rojas que los hagan derretirse y unos bombones que los dejen deseando mucho más. Entregale tu corazón y disfrutad juntos de la vida.\",\"ca\":\"Expressar el que un sent és igual de difícil que acceptar-ho un mateix. Per aixó, aquest combo ho dirá tot per tú. Unes quantes roses vermelles que els facin derretir-se i uns quants bombons que els deixin desitjar molt més. Entrega-li el teu cor i gaudiu la vida plegats.\",\"en\":\"Expressing what one feels is as difficult as accepting it one itself. That is why this combo will say it all for you. A few red roses that will make them melt of love and some chocolates that will leave them wanting more. Give them your heart and enjoy your lives together.\"}', 'combo-transparente-2-l-rojo.jpg', 66.00, 0.00, '', 0.00, '', 0.00, '', '', '', 1, '2022-02-01 08:02:05', '2022-02-02 12:49:39'),
