(200, NULL, 0, 'SV-001-8', 'combo-transparente-2-m-rosa', 'combo-transparente-2-m-rosa', 'combo-transparente-2-m-rosa', '{\"es\":\"MI MUNDO IDEAL\",\"ca\":\"MI MUNDO IDEAL\",\"en\":\"MI MUNDO IDEAL\"}', '0OSV0', '', 'simple', '{\"es\":\"Expresar lo que uno siente es igual de difícil que aceptarlo uno mismo. Por eso, este combo lo dirá todo por tí. Unas cuantas rosas rosas que los hagan derretirse y unos bombones que los dejen deseando mucho más. Regálale el mundo y disfrutadlo los dos sin más.\",\"ca\":\"Expressar el que un sent és igual de difícil que acceptar-ho un mateix. Per aixó, aquest combo ho dirá tot per tú. Unes quantes roses roses que els facin derretir-se i uns quants bombons que els deixin desitjar molt més. Regala-li el món i gaudiu-lo plegats.\",\"en\":\"Expressing what one feels is as difficult as accepting it one itself. That is why this combo will say it all for you. A few pink roses that will make them melt of love and some chocolates that will leave them wanting more. Give them the world and share it together.\"}', 'combo-transparente-2-m-rosa.jpg', 65.00, 0.00, '', 0.00, '', 0.00, '', '', '', 1, '2022-02-01 08:06:48', '2022-02-02 12:49:06'),
(201, NULL, 0, 'SV-002-1', 'make-with-love-l', 'make-with-love-l', 'make-with-love-l', '{\"es\":\"MADE WITH LOVE\",\"ca\":\"MADE WITH LOVE\",\"en\":\"MADE WITH LOVE\"}', '0OSV0', '', 'simple', '{\"es\":\"El amor no son tan sólo palabras, son actos que demuestran todo el cariño y admiración que uno siente hacia la otra persona. Una buena manera de hacerlo es regalándole el pack Made With Love de Marshall, donde las rosas transmiten su ternura y el chocolate la complementa con toda su dulzura.\",\"ca\":\"L ́amor no són només paraules, són actes que demostren tot el carinyo i admiració que un sent per l ́altre persona. Una bona manera de fer-ho és regalant el pack Made With Love de Marshall, on les roses transmeten la tendresa i la xocolata la complementa amb tota la seva dolçor.\",\"en\":\"Love is not all about words, it ́s actions that speak louder than those, transmitting all its passion, admiring all its beauty, and surrendering to its strength. You can do that by giving out a Made With Love pack from Marshall, where the roses do the talking and the chocolate sweetens the words.\"}', 'make-with-love-l.jpg', 93.00, 0.00, '', 0.00, '', 0.00, '', '', '', 1, '2022-02-01 08:08:57', '2022-02-02 12:40:43'),
