(203, NULL, 0, 'SV-002-3', 'make-with-love-s', 'make-with-love-s', 'make-with-love-s', '{\"es\":\"MADE FOR YOU\",\"ca\":\"MADE FOR YOU\",\"en\":\"MADE FOR YOU\"}', '0OSV0', '', 'simple', '{\"es\":\"El amor no son tan sólo palabras, son actos que demuestran todo el cariño y admiración que uno siente hacia la otra persona. Una buena manera de hacerlo es regalándole el pack Made For You de Marshall, donde las rosas transmiten su ternura y el chocolate la complementa con toda su dulzura.\",\"ca\":\"L ́amor no són només paraules, són actes que demostren tot el carinyo i admiració que un sent per l ́altre persona. Una bona manera de fer-ho és regalant el pack Made For You de Marshall, on les roses transmeten la tendresa i la xocolata la complementa amb tota la seva dolçor.\",\"en\":\"Love is not all about words, it ́s actions that speak louder than those, transmitting all its passion, admiring all its beauty, and surrendering to its strength. You can do that by giving out a Made For You pack from Marshall, where the roses do the talking and the chocolate sweetens the words.\"}', 'make-with-love-s.jpg', 37.00, 0.00, '', 0.00, '', 0.00, '', '', '', 1, '2022-02-01 08:10:47', '2022-02-02 12:42:24'),
(204, NULL, 3, 'SV-003-1', 'combo-negro-l', 'combo-negro-l', 'combo-negro-l', '{\"es\":\"CASADOS A LO GRANDE\",\"ca\":\"CASADOS A LO GRANDE\",\"en\":\"CASADOS A LO GRANDE\"}', '0OSV0', '', 'simple', '{\"es\":\"Un regalo para hacer feliz a la persona que merece una buena dosis de amor pasional y un poco de dulzura en los labios. No hay nada mejor que pétalos rojos para demostrar tu amor y un buen chocolate para disfrutar de un momento romántico.\",\"ca\":\"Un regal per fer feliç a la persona que mereix una bona dosis d ́amor passional i una mica de dolçor als llavis. No hi ha res millor que pétals vermells que demostrint el teu amor i una bona xocolata per gaudir d ́un moment romantic.\",\"en\":\"A gift specially made to make that unique person a bit more happier by giving them a good dose of passionate love and a tiny bit of sweeter taste to their lips. There\'s nothing better than red vivid petals that demonstrate all your affection, and a nice chocolate for the both of you to enjoy the romantic moment.\"}', 'combo-negro-l.jpg', 53.00, 0.00, '', 0.00, '', 0.00, '', '', '', 1, '2022-02-01 08:14:29', '2022-02-03 12:37:23'),
