(208, NULL, 0, 'SV-003-5', 'osito-negro-s', 'osito-negro-s', 'osito-negro-s', '{\"es\":\"DARK LOVE\",\"ca\":\"DARK LOVE\",\"en\":\"DARK LOVE\"}', '0OSV0', '', 'simple', '{\"es\":\"¿A quién no le encanta recibir un osito de peluche por San Valentín? Si quieres hacerle un detalle romántico a tu pareja, esta cajita negra con rosas rojas los dejará sin palabras. Simple y mono.\",\"ca\":\"A qui no li encanta rebre un osset de peluix per el Dia dels Enamorats? Si vols fer un detall romantic a la teva parella, aquesta capseta negre de roses vermelles els deixarà sense paraules. Simple i bufó.\",\"en\":\"Who doesn ́t like getting a teddy bear for San Valentine ́s Day? If you want to give a small romantic detail to your partner, this black box with red roses will leave them without words. Simple and cute.\"}', 'osito-negro-s.jpg', 42.00, 0.00, '', 0.00, '', 0.00, '', '', '', 1, '2022-02-01 08:21:02', '2022-02-02 12:43:51'),
