(211, NULL, 2, 'SV-004-1', 'combo-corazon-rosa', 'combo-corazon-rosa', 'combo-corazon-rosa', '{\"es\":\"BESOS ROSAS\",\"ca\":\"BESOS ROSAS\",\"en\":\"BESOS ROSAS\"}', '0OSV0', '', 'simple', '{\"es\":\"El regalo ideal para San Valentín para quien quiera demostrar a su pareja que cada uno de sus besos es una rosa de este ramo, igual que su delicadeza, con su misma pasión y su única dulzura. Un ramo que habla por sí sólo y te deja sin palabras.\",\"ca\":\"El regal ideal per Sant Valentí per qui vulgui demostrar a la seva parella que cada un dels seus petons és una rosa d ́aquest ram, igual que la seva delicadeza, la mateixa passió i la seva dolçor. Un ram que parla per si sól i et deixa sense paraules.\",\"en\":\"The ideal San Valentine’s gift for whoever desires to show their loved ones that each and every rose of the bouquet is like each and every one of their kisses. With its sensitivity, passion, and tenderness, this becomes a gift which says more than a thousand words.\"}', 'combo-corazon-rosa.jpg', 54.00, 0.00, '', 0.00, '', 0.00, '', '', '', 1, '2022-02-01 08:24:51', '2022-02-03 12:35:02'),
