INSERT INTO `web_pages` (`id`, `es_slug`, `ca_slug`, `en_slug`, `type`, `categories`, `tags`, `name`, `description`, `content`, `seo`, `meta`, `active`, `created_at`, `updated_at`) VALUES
(6, 'algunas-de-las-plantas-medicinales-mas-comunes', 'algunas-de-las-plantas-medicinales-mas-comunes', 'algunas-de-las-plantas-medicinales-mas-comunes', 'blog', 'Plantas', 'medicina', '{\"es\":\"Algunas de las plantas medicinales m\\u00e1s comunes\",\"ca\":\"Algunas de las plantas medicinales m\\u00e1s comunes\",\"en\":\"Algunas de las plantas medicinales m\\u00e1s comunes\"}', '{\"es\":\"Hasta hace no demasiados a\\u00f1os, las plantas y flores, m\\u00e1s que un elemento decorativo, eran populares por ser los ingredientes de medicinas y remedios que curaban todo tipo de mal (bueno, vi\\u00e9ndolo con perspectiva quiz\\u00e1 es muy osado decirlo, pero en ese entonces eran miraculosas). Con los avances tecnol\\u00f3gicos, hemos prescindido de muchas de ellas, pero sigue habiendo muchas plantas que cuentan con unas propiedades que nos pueden ser muy beneficiosas y nos pueden sacar de m\\u00e1s de un apuro. En esta entrada os vamos a mostrar algunas de las plantas medicinales m\\u00e1s comunes que podemos encontrar hoy d\\u00eda. Porque nunca sabes cuando te puedes encontrar en el monte y que te aparezca de la nada una indigesti\\u00f3n salvaje\\u2026\",\"ca\":\"Hasta hace no demasiados a\\u00f1os, las plantas y flores, m\\u00e1s que un elemento decorativo, eran populares por ser los ingredientes de medicinas y remedios que curaban todo tipo de mal (bueno, vi\\u00e9ndolo con perspectiva quiz\\u00e1 es muy osado decirlo, pero en ese entonces eran miraculosas). Con los avances tecnol\\u00f3gicos, hemos prescindido de muchas de ellas, pero sigue habiendo muchas plantas que cuentan con unas propiedades que nos pueden ser muy beneficiosas y nos pueden sacar de m\\u00e1s de un apuro. En esta entrada os vamos a mostrar algunas de las plantas medicinales m\\u00e1s comunes que podemos encontrar hoy d\\u00eda. Porque nunca sabes cuando te puedes encontrar en el monte y que te aparezca de la nada una indigesti\\u00f3n salvaje\\u2026\",\"en\":\"Hasta hace no demasiados a\\u00f1os, las plantas y flores, m\\u00e1s que un elemento decorativo, eran populares por ser los ingredientes de medicinas y remedios que curaban todo tipo de mal (bueno, vi\\u00e9ndolo con perspectiva quiz\\u00e1 es muy osado decirlo, pero en ese entonces eran miraculosas). Con los avances tecnol\\u00f3gicos, hemos prescindido de muchas de ellas, pero sigue habiendo muchas plantas que cuentan con unas propiedades que nos pueden ser muy beneficiosas y nos pueden sacar de m\\u00e1s de un apuro. En esta entrada os vamos a mostrar algunas de las plantas medicinales m\\u00e1s comunes que podemos encontrar hoy d\\u00eda. Porque nunca sabes cuando te puedes encontrar en el monte y que te aparezca de la nada una indigesti\\u00f3n salvaje\\u2026\"}', '{\"es\":\"<h2>Aloe Vera<\\/h2><p>Empezamos con un <strong>cl\\u00e1sico<\\/strong>. Qui\\u00e9n m\\u00e1s quien menos, todos hemos o\\u00eddo hablar de alguno de los beneficios que no ofrece esta planta. Y es que el <a href=\\\"https:\\/\\/rosistirem.com\\/loe\\/\\\">Aloe Vera<\\/a> va m\\u00e1s all\\u00e1 de sus frecuentes usos como sanadora de piel: es una planta que <strong>aporta beneficios para la salud en general<\\/strong>.<\\/p><p>Empezando por lo m\\u00e1s superficial y como coment\\u00e1bamos, el Aloe Vera <strong>ayuda a limpiar la suciedad de los poros, a hidratar la piel e incluso tiene una funci\\u00f3n de astringente<\\/strong>. \\u00a1Un imprescindible para las <em>skin care routine<\\/em>!<\\/p><div class=\\\"se-component se-image-container __se__float- __se__float-none\\\" contenteditable=\\\"false\\\"><figure style=\\\"margin: 0px;\\\"><img src=\\\"https:\\/\\/rosistirem.com\\/wp-content\\/uploads\\/2021\\/07\\/ALOE-VERA-1024x819.jpg\\\" alt=\\\"\\\" data-proportion=\\\"true\\\" data-align=\\\"none\\\" data-index=\\\"0\\\" data-file-name=\\\"ALOE-VERA-1024x819.jpg\\\" data-file-size=\\\"0\\\" data-origin=\\\",\\\" data-size=\\\",\\\" data-rotate=\\\"\\\" data-rotatex=\\\"\\\" data-rotatey=\\\"\\\" style=\\\"\\\" data-percentage=\\\"auto,auto\\\"><\\/figure><\\/div><div><br>\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t<\\/div><p>Otro de sus m\\u00e1gicas propiedades, es que <strong>ayuda a la cicatrizaci\\u00f3n de heridas<\\/strong><br> en la piel. Y no solo ayuda a cerrar las heridas, sino que sus <br>componentes hacen que las cicatrices queden m\\u00e1s uniformes con la piel y <br>se disimulen.<\\/p><p>Las picaduras de insectos, las reacciones al\\u00e9rgicas <br>en la piel, las irritaciones, golpes, dolencias musculares o quemaduras <br>por el sol tampoco son un enemigo para el Aloe Vera. Y esto es gracias a<br> su&nbsp;<strong>propiedad antiinflamatoria<\\/strong>.<\\/p><p>Y lo mejor de todo es que a diferencia de otros cosm\\u00e9ticos, \\u00a1<strong>se adapta a todos los tipos de piel<\\/strong>! Ni los mejores laboratorios han conseguido esto.<\\/p><p>Por si fueran pocos los beneficios del Aloe Vera que hemos comentado hasta ahora, esta planta ayuda a <strong>fortalecer el cabello, reduciendo posibles irritaciones y la tan odiada caspa<\\/strong>.<\\/p><p>Dejando la parte m\\u00e1s superficial del cuerpo, esta planta tiene unas propiedades que <strong>facilitan la digesti\\u00f3n<\\/strong> y <strong>alivian varios de los problemas gastrointestinales<\\/strong> m\\u00e1s comunes, como el reflujo o el estre\\u00f1imiento. \\u00a1Y la guinda del pastel es que est\\u00e1 <strong>repleta de vitaminas y minerales<\\/strong>!<\\/p><p>\\u00a1De hecho, en su d\\u00eda, ya le dedicamos <a href=\\\"https:\\/\\/rosistirem.com\\/propiedades-del-aloe-vera\\/\\\">un art\\u00edculo entero a los beneficios del Aloe Vera<\\/a>!<\\/p><p><br><\\/p>\",\"ca\":\"<h2>Aloe Vera<\\/h2><p>Empezamos con un <strong>cl\\u00e1sico<\\/strong>. Qui\\u00e9n m\\u00e1s quien menos, todos hemos o\\u00eddo hablar de alguno de los beneficios que no ofrece esta planta. Y es que el <a href=\\\"https:\\/\\/rosistirem.com\\/loe\\/\\\">Aloe Vera<\\/a> va m\\u00e1s all\\u00e1 de sus frecuentes 